import { Grid } from "../CoreUI/Grid/Grid";
import { GridElement } from "../CoreUI/Grid/GridElement";

export const ThemeForm = () => {
  return <Grid numCols={12} numRows={3} rowUnit="135px" colUnit="56px" key={1}>
    <GridElement
      position={{
        startCol: 1,
        endCol: 5,
        startRow: 1,
        endRow: 3,
      }}
    ></GridElement>
    <GridElement
      position={{
        startCol: 5,
        endCol: 9,
        startRow: 1,
        endRow: 3,
      }}
    ></GridElement>
    <GridElement
      position={{
        startCol: 9,
        endCol: 13,
        startRow: 1,
        endRow: 3,
      }}
    ></GridElement>
    <GridElement
      position={{
        startCol: 1,
        endCol: 5,
        startRow: 3,
        endRow: 4,
      }}
    ></GridElement>
    <GridElement
      position={{
        startCol: 5,
        endCol: 9,
        startRow: 3,
        endRow: 4,
      }}
    ></GridElement>
    <GridElement
      position={{
        startCol: 9,
        endCol: 13,
        startRow: 3,
        endRow: 4,
      }}
    ></GridElement>
  </Grid>;
};
